<!DOCTYPE html>
<html lang="zh">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>身份证前6穷举</title>
    <style>
        body {
            font-family: Arial, sans-serif;
            margin: 20px;
            background: linear-gradient(135deg, #e0eafc 0%, #cfdef3 100%);
            color: #333;
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            overflow: hidden;
        }

        #main {
            transition: opacity 0.4s ease-in-out, transform 0.4s ease-in-out;
            margin-bottom: 0;
            position: relative;
            width: 100%;
            max-width: 600px;
            background: linear-gradient(135deg, #e0eafc 0%, #cfdef3 100%);
            border-radius: 12px;
            backdrop-filter: blur(10px);
            border: 1px solid rgba(0, 0, 0, 0.05);
            box-shadow: 0 2px 6px rgba(0, 0, 0, 0.1);
            padding: 20px;
            text-align: center;
            max-height: 80vh;
            overflow: auto;
        }

        h1 {
            color: #0077b6;
            font-size: 2em;
            margin-bottom: 20px;
            transition: color 0.5s ease;
        }

        label, input, button, select {
            display: block;
            margin: 0 auto 10px auto;
            text-align: center;
            width: 80%;
            max-width: 400px;
            box-sizing: border-box;
            animation: fadeIn 1s ease-in-out;
        }

        label {
            font-size: 1.2em;
        }

        input, select {
            padding: 10px;
            font-size: 1em;
            border: 1px solid #ccc;
            border-radius: 5px;
            transition: border-color 0.3s ease;
        }

        input:focus, select:focus {
            border-color: #0077b6;
        }

        button {
            background-color: #0077b6;
            color: #fff;
            padding: 10px;
            font-size: 1.2em;
            border: none;
            border-radius: 5px;
            cursor: pointer;
            transition: background-color 0.3s ease;
        }

        button:hover {
            background-color: #005f8a;
        }

        #results-container {
            max-height: 400px;
            overflow-y: auto;
            margin-top: 20px;
            text-align: left;
        }

        #results {
            text-align: center;
            animation: fadeIn 1s ease-in-out;
        }

        #results h3 {
            font-size: 1.5em;
            color: #0077b6;
            margin-bottom: 10px;
        }

        #results ul {
            list-style-type: none;
            padding: 0;
        }

        #results li {
            font-size: 1.2em;
            margin: 5px 0;
        }

        #results p {
            font-size: 1.2em;
            color: #0077b6;
        }

        #searchBox {
            margin-top: 20px;
            display: none; /* Hide the search box initially */
        }

        #searchBox input {
            padding: 10px;
            font-size: 1em;
            border: 1px solid #ccc;
            border-radius: 5px;
            box-sizing: border-box;
        }

        #exportButton {
            display: none; /* Hide export button initially */
        }
    </style>
</head>

</div>
